import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter } from 'react-router-dom';
import { Routes, Route, Router } from 'react-router-dom';

import Home from './components/sub/home';
import Test from './components/sub/testRoute';
import NoPage from './components/sub/NoPage';
import Navbar from './components/sub/NavBar';
import Footer from './components/sub/footer';

import Axios from 'axios'

/*
    Axios({
      method: "GET",
      url: "https://lazy-cyan-basket-clam-veil.cyclic.app/testAPI",
      headers: {
        "Content-Type": "application/json"
      }
    }).then(res => {
      this.setState({ apiResponse: res.data })
    });
    */

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/testAPI" element={<Test />} />
        <Route path="*" element={<NoPage />} />
      </Routes>
      <Footer />
    </BrowserRouter>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
